import React from 'react'
import {useEffect, useRef} from "react";
import {gsap} from "gsap";

 const Canvas = (props) => {

let canvasRef = useRef(null);


useEffect(() => {

    let ctx = canvasRef.current.getContext("2d");
    let particles = [];


let img = new Image();
img.src = "data:image/png;base64,"

let render = function(){
    
    ctx.clearRect(0,0,1000,1000);
    
    
    for(let i = 0; i<particles.length; i++){
        let particle = particles[i];
         
        ctx.fillStyle = particle.color;
        ctx.fillRect(particle.x1 *3, particle.y1 * 3, 2, 2)
    }
    requestAnimationFrame(render);
    
}

img.onload = () => {
//draw image on canvas
ctx.drawImage(img, 0, 0, img.width, img.width);
let imageData =  ctx.getImageData(0, 0, img.width, img.height);
console.log(props.height)
console.log(props.width);
// clear the rectangle
ctx.clearRect(0,0,1000,1000);

//ctx.fillStyle = "green";
for(let y=0; y<imageData.height; y++){
for(let x=0; x<imageData.width; x++){
    let p = 4 * x + (y*imageData.width * 4);
    
    if(imageData.data[p+3] > 128){
        let particle = {
            x0 : x,
            y0: y,
            x1:img.width/2,
            y1:img.height/2,
            color: "rgb("+imageData.data[(y * 4 * imageData.width)+ (x * 4)]+","+imageData.data[(y * 4 * imageData.width)+ (x * 4) +1]+","+imageData.data[(y * 4 * imageData.width)+ (x * 4) +2]+")"
        }
        
        
         gsap.to(particle, {x1:particle.x0, y1:particle.y0, duration: Math.random() * 8, ease: "bounce.out"});

        particles.push(particle);
    }
}

}
requestAnimationFrame(render);
}
   
})


    return (
        <div>
            <canvas ref={canvasRef} width={props.width} height={props.height} />
              
            
        </div>
    )
}
export default Canvas;
